import { StyleCardCreate } from "./styles";
import Input from "../input/index";
import { useForm } from "react-hook-form";
import Button from "../button/index";

const CardCreate = ({ createHabit }) => {
  const { register, handleSubmit } = useForm();
  const onSubmit = (data) => {
    createHabit(data);
    console.log(data);
  };
  return (
    <StyleCardCreate>
      <form onSubmit={handleSubmit(onSubmit)}>
        <Textfild {...register("title")} label="Title" type="text"></Textfild>
        <Textfild
          {...register("category")}
          label="Category"
          type="text"
        ></Textfild>
        <Textfild
          {...register("difficulty")}
          label="Difficulty"
          type="text"
        ></Textfild>
        <Textfild
          {...register("frequency")}
          label="Frequency"
          type="text"
        ></Textfild>
        <Textfild
          {...register("achieved")}
          label="Achieved"
          type="text"
        ></Textfild>
        <Textfild
          {...register("how_much_achieved")}
          label="How much achieved"
          type="text"
        ></Textfild>
        <Button type="submit"></Button>
      </form>
    </StyleCardCreate>
  );
};

export default CardCreate;
